import React, { useState, useEffect } from "react";
import Item from "./Item";

// Utilizo Destructuring en la línea 5
export const ItemDetail = (props) => {
  return (
    <>
      // Recorrer y mostrar array con relojes
      <div className="row">
        <div className="smartwatches-container">
          <Item
            key={props.smartwatch.id}
            title={props.smartwatch.title}
            price={props.smartwatch.price}
            pictureUrl={props.smartwatch.pictureUrl}
            alt={props.smartwatch.alt}
          />
        </div>
      </div>
    </>
  );
};

export default ItemDetail;
